measurements.description:
Twenty-one round, flat flowers and one bud evenly arranged on one 98.5-cm  arching inflorescence, eight buds on a 56-cm arching inflorescence;
	sepals clear yellow, dorsal sepal faint red stripe centrally;
	petals clear yellow;
	lip slightly ruffled, white, yellow distally, dark red blotches near lower margins and centrally, sidelobes overlaid yellow;	

	column yellow, faintly blushed red, anther cap yellow;


    substance firm; texture matte.
